import styles from './Table.module.scss';

interface IProps {
  ip: string;
  location: string;
  timezone: string;
  isp: string;
}

export const Table = ({ip, location, timezone, isp}: IProps) => {
  return <div className={styles.table}>
    {[0,1,2,3].map(item => {
     return <div className={styles.cell}>
      <div className={styles.cellTitle}></div>
      <div className={styles.cellContent}></div>
     </div> 
    })}
  </div>
}
